INSERT INTO `wp_eemail_newsletter` (`eemail_id`, `eemail_subject`, `eemail_content`, `eemail_status`, `eemail_date`) VALUES
(1, 'Sample Subject', 'This is sample mail content, Can add HTML content here.', 'YES', '2015-03-13 00:00:00'),
(2, 'Sample HTML Mail', '<strong style="color: #990000"> Email newsletter</strong><p>Email newsletter plugin have option to send HTML Mails/Newsletters to registered user, Comment author, Subscriber and Users who contacted you. Sending email is much cheaper than most other forms of communication. Email marketing has proven very successful for those who do it right. This plugin is very useful those who need to send Newsletters to users who subscribed to your blogs.</p> <strong style="color: #990000">Advantage of this plugin</strong><ol> <li>No coding knowledge required to setup this plugin.</li> <li>Very easy installation and setup.</li><li>Option to send email newsletter to registered user.</li> <li>Option to send email newsletter to commenter (Comment author).</li> <li>Option to send email newsletter to users who contacted you.</li> <li>Option to setup email subscription box and option to send email newsletter to subscriber.</li> <li>Option to setup unsubscribe link in newsletter.</li><li>Option to Export and Import email address.</li> <li>Automatic welcome email to new subscriber.</li><li>Admin email notification for every new subscriber.</li> </ol><strong style="color: #990000">Thanks & Regards</strong><br>www.gopiplus.com', 'YES', '2015-03-13 00:00:00');
