(939, 1, '2015-11-05 15:06:41', '2015-11-05 15:06:41', '<div class="panel-box col-md-6">\n<p style="font-size: 26px;"><strong><span style="font-size: 30px;">EASE</span> </strong>stock a large range of air starter motors,underground mining tools and equipment,<strong>air operated diaphragm pumps</strong><span style="font-weight: bold;">,</span> hand held air tools, compressors and pneumatic accessories.</p>\n<p style="font-size: 20px;"><a class="various fancybox.iframe" href="http://www.youtube.com/v/Vg36UMM-0H0?fs=1&amp;autoplay=1"><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/themes/main/images/button-youtube.jpg" alt="" /></a><a href="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/11/youtube.png"><img class="alignnone size-full wp-image-1035" src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/11/youtube.png" alt="youtube" width="158" height="114" /></a></p>\n<p style="font-size: 20px;"><strong><span style="font-size: 20px;">EASE</span> </strong>can provide sales and speciality services of all air operated equipment from a basic hand held air toll through to roof bolters and rib drills - including operating Queensland''s only <strong><span style="font-size: 20px;">Rambor Test Bench</span></strong> offering customers a specialised form of roof bolter testing - including <strong><span style="font-size: 20px;">motor rotation and leg force testing</span></strong> of all underground mining roof bolters!</p>\n\n</div>', 'Session 1', '', 'inherit', 'closed', 'closed', '', '930-autosave-v1', '', '', '2015-11-05 15:06:41', '2015-11-05 15:06:41', '', 930, 'http://dev.dusted.com.au/dev_ease_woo/930-autosave-v1/', 0, 'revision', '', 0),
