(1049, 1, '2015-11-05 17:45:01', '2015-11-05 17:45:01', '<div class="container about-container">\r\n<h1 class="title-page">About Us</h1>\r\n<h2 style="font-size: 45px;">Emerald Air Starters &amp; Equipment <img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/ease.png" alt="" /></h2>\r\nis<strong> proud</strong> to be a part of the <img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/dowends-group.png" alt="" />\r\n\r\n&nbsp;\r\n\r\n<hr />\r\n\r\n&nbsp;\r\n<p style="font-size: 20px;"><span style="font-size: 25px;"> EASE is a <strong> member of</strong> <span style="color: #005595;">the I.S.G. - Industrial Supply Group</span></span>.</p>\r\nThe I.S.G. is a coalition of major independent industrial supply companies servicing customers Australia wide, with the proven <strong>capacity to service national accounts.\r\n</strong>\r\n\r\n&nbsp;\r\n\r\n<hr />\r\n\r\n&nbsp;\r\n<p style="font-size: 20px;"><strong>EASE</strong> are the<strong> sole authorised distributor</strong> of <span style="color: #005595;">Atlas Copco Compressors and Tools</span> in Emerald,</p>\r\nQueensland, and are also trusted distributors of SMC Pneumatics and Philmac.\r\n\r\n&nbsp;\r\n\r\n<hr />\r\n\r\n&nbsp;\r\n<div class="row">\r\n<div class="col-md-6 col-xs-12">\r\n<p style="font-size: 30px;">EASE operates Queensland''s <strong>only Rambor Test Bench</strong> offering customers a specialised form of roof bolter testing -\r\nincluding <strong>motor rotation and leg force testing </strong>of all underground mining roof bolters!</p>\r\n<a class="btn btn-success" style="background: #faa736; border: none; padding: 15px 30px; font-size: 18px;" href="http://dev.dusted.com.au/dev_ease_woo/contact-us.html">GET A <span style="color: #fff; font-weight: bold;">FREE</span> QUOTE</a>\r\n\r\n</div>\r\n<div class="col-md-6 col-xs-12 text-right"><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/about-us-1.png" alt="" /></div>\r\n</div>\r\n&nbsp;\