dusted.com.au/dev_ease_woo/wp-content/themes/main/images/bg_pic3.jpg'') no-repeat scroll center top / cover;">\r\n<div class="ahlu-body">\r\n<div class="ahlu-body-layer"></div>\r\n<div class="panel-box ">\r\n<p style="font-size: 40px; width: 60%; text-align: center; color: white;"><strong class="bold">EASE</strong> has an extensive range of ATEX\r\napproved hire equipment specially\r\n<strong class="bold">designed to assist </strong>production in the\r\nunderground mining <strong class="bold">industry</strong>.</p>\r\n<a class="btn btn-success" style="background: #fd682e; border: none; font-size: 23px; padding: 15px 30px;" href="#">Call us: 0749875488</a>\r\n\r\n</div>\r\n</div>\r\n</div>', 'About', '', 'inherit', 'closed', 'closed', '', '730-revision-v1', '', '', '2015-11-05 17:45:01', '2015-11-05 17:45:01', '', 730, 'http://dev.dusted.com.au/dev_ease_woo/730-revision-v1/', 0, 'revision', '', 0);
