(1028, 1, '2015-11-05 13:53:04', '2015-11-05 13:53:04', '<div class="container about-container">\r\n<h1 class="title-page">Servicing</h1>\r\n<h2 style="font-size: 45px;">Emerald Air Starters &amp; Equipment <img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/ease.png" alt="" />\r\n<br/>\r\nis<strong> proud</strong> to be a part of the <img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/dowends-group.png" alt="" /></h2>\r\n<br/>\r\n<hr />\r\n\r\n<br/>\r\n<p style="font-size: 20px;"><span style="font-size: 25px;"> EASE is a <strong> member of</strong> <span style="color: #005595;">the I.S.G. - Industrial Supply Group</span></span>.\r\n\r\nThe I.S.G. is a coalition of major independent industrial supply companies servicing customers Australia wide, with the proven <strong>capacity to service national accounts.\r\n</strong></p>\r\n<br/>\r\n<hr />\r\n<br/>\r\n<p style="font-size: 20px;"><strong>EASE</strong> are the<strong> sole authorised distributor</strong> of <span style="color: #005595;">Atlas Copco Compressors and Tools</span> in Emerald,\r\n\r\nQueensland, and are also trusted distributors of SMC Pneumatics and Philmac.</p>\r\n<br/><br/>\r\n\r\n<hr />\r\n<br/>\r\n&nbsp;\r\n<div class="row">\r\n<div class="col-md-6 col-xs-12">\r\n<p style="font-size: 30px;">EASE operates Queensland''s <strong>only Rambor Test Bench</strong> offering customers a specialised form of roof bolter testing -\r\nincluding <strong>motor rotation and leg force testing </strong>of all underground mining roof bolters!</p>\r\n<a class="btn btn-success" style="background: #faa736; border: none; padding: 15px 30px; font-size: 18px;" href="#">GET A <span style="color: #fff; font-weight: bold;">FREE</span> QUOTE</a>\r\n<br/><br/>\r\n</div>\r\n<div class="col-md-6 col-xs-12 text-right"><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/about-us-1.png" alt="" /></div>\r\n</div>\r\n<br/>\r\n<hr />\r\n<br/>\r\n<div class="branch" style="text-align: center;">\r\n<h1>AGENTS &amp; DISTRIBUTORSHIPS</h1>\r\n&nbsp;\r\n<div class="logos row">\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/austart.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/airmac.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/wilden.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/westinghouse.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/rambor.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/fscurtis.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/ingersolirand.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/atlascopco.png" alt="" /></div>\r\n<div class="col-md-4 col-sm-4 col-xs-12 "><img src="http://dev.dusted.com.au/dev_ease_woo/wp-content/uploads/2015/10/smc.png" alt="" /></div>\r\n</div>\r\n&nbsp;\r\n<div class="logos row">\r\n<p style="font-size: 16px;"><strong> EASE</strong> have been operating in Emerald for over <strong>20</strong> years, and sell and service <strong>quality</strong>.\r\nThe Dowdens Group &amp; Emerald Air Starters &amp; Equipment are also Queensland''s sole distributor of <span style="color: #005595;">WILDEN</span>.</p>\r\n&nbsp;\r\n\r\n</div>\r\n</div>\r\n</div>\r\n<div class="wrapper ahlu-box panel-6" style="background: url(''http://dev.dusted.com.au/dev_ease_woo/wp-content/themes/main/images/bg_pic3.jpg'') no-repeat scroll center top / cover ">\r\n<div class="ahlu-body">\r\n<div class="ahlu-body-layer"></div>\r\n<div class="panel-box ">\r\n<p style="font-size: 40px;width:60%; text-align: center; color: white;"><strong class="bold">EASE</strong> has an extensive range of ATEX\r\napproved hire equipment specially\r\n<strong class="bold">designed to assist </strong>production in the\r\nunderground mining <strong class="bold">industry</strong>.</p>\r\n<a class="btn btn-success" style="background: #fd682e; border: none; font-size: 23px; padding: 15px 30px;" href="#">Call us: 0749875488</a>\r\n\r\n</div>\r\n</div>\r\n</div>', 'Servicing', '', 'publish', 'closed', 'closed', '', 'servicing', '', '', '2015-11-05 13:56:48', '2015-11-05 13:56:48', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/?page_id=1028', 0, 'page', '', 0);
