(1294, 1, '2016-01-04 05:33:39', '2016-01-04 05:33:39', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Radical Torque Solutions RAD Gen-X Series Torque Multipliers</b> are designed for extreme duty use in a variety of industrial applications. Worldwide the Radical Torque Solutions RAD Gen-X Series are recognised as the next generation in torque wrenches.</p>\r\n\r\n<ul>\r\n<li>The ultimate in power to weight ratio</li>\r\n<li>Wide torque range to suit multiple applications</li>\r\n<li>Unmatched reliability delivered by one of the most advanced engineered gearboxes on the market</li>\r\n<li>All RAD Gen-X Series Pneumatic Tools are supplied with:</li> \r\n<ul><li>Reaction arm</li>\r\n<li>3M hose & tool holder</li>\r\n<li>Filter / Regulator / Lubricator</li>\r\n<li>Waterproof Site Box & Instruction Manual</li></ul>\r\n</ul><br />\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;">\r\n<table style="width: 800px;" border="1" cellspacing="1" cellpadding="1">\r\n<tbody>\r\n<tr>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Part\r\nNumber</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Square Drive</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Torque</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Speed</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Weight</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Noise Level</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>7GX</strong></span></td>\r\n<td><em><span style="color: #000000;">12814</span></em></td>\r\n<td><span style="color: #000000;">3/4"</span></td>\r\n<td><span style="color: #000000;">135-950 Nm</span></td>\r\n<td><span style="color: #000000;">30 RPM</span></td>\r\n<td><span style="color: #000000;">3.6 kg</span></td>\r\n<td><span style="color: #000000;">80 Dba</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>10GX</strong></span></td>\r\n<td><em><span style="color: #000000;">12818</span></em></td>\r\n<td><span style="color: #000000;">3/4"</span></td>\r\n<td><span style="color: #000000;">270-1350 Nm</span></td>\r\n<td><span style="color: #000000;">20 RPM</span></td>\r\n<td><span style="color: #000000;">3.6 kg</span></td>\r\n<td><span style="color: #000000;">80 Dba</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>25GX</strong></span></td>\r\n<td><em><span style="color: #000000;">12377</span></em></td>\r\n<td><span style="color: #000000;">1"</span></td>\r\n<td><span style="color: #000000;">700-3400 Nm</span></td>\r\n<td><span style="color: #000000;">9 RPM</span></td>\r\n<td><span style="color: #000000;">6.1 kg</span></td>\r\n<td><span style="color: #000000;">85 Dba</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>15DX</strong></span></td>\r\n<td><em><span style="color: #000000;">17328</span></em></td>\r\n<td><span style="color: #000000;">1"</span></td>\r\n<td><span style="color: #000000;">400-2000 Nm</span></td>\r\n<td><span style="color: #000000;">10.4 RPM</span></td>\r\n<td><span style="color: #000000;">3.9 kg</span></td>\r\n<td><span style="color: #000000;">85 Dba</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>34GX</strong></span></td>\r\n<td><em><span style="color: #000000;">12356</span></em></td>\r\n<td><span style="color: #000000;">1"</span></td>\r\n<td><span style="color: #000000;">1350-4600 Nm</span></td>\r\n<td><span style="color: #000000;">12 RPM</span></td>\r\n<td><span style="color: #000000;">9 kg</span></td>\r\n<td><span style="color: #000000;">85 Dba</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>60DX</strong></span></td>\r\n<td><em><span style="color: #