(1238, 1, '2015-12-17 22:25:28', '2015-12-17 22:25:28', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco LMS8-Series Impact Wrenches</b> deliver true raw power and enable extremely fast tightening and loosening. The innovative and unique grease retaining system ensures maximum tool performance with long service intervals. For an impact wrench, the LMS8 also has extraordinarily low vibration levels. Once you have experienced the feel and great performance of the LMS8 there is no substitute.</p>\r\n<p>Atlas Copco impact wrenches are designed to provide dependability and a long, trouble-free service life in the toughest conditions. Few other tools can match the Atlas Copco impact wrench when it comes to flexibility, capacity-to-weight ratio and simplicity in use and maintenance. The LMS models are non shut-off, which means they shut off once the operator releases the trigger. The LMS models are designed for use in the <em>Australian mining & construction industries</em>.</p>\r\n<br /><iframe src="https://www.youtube.com/embed/vEb_XFoqjrw" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;">\r\n</div>', 'LMS08 HR10 Impact Wrench', 'Atlas Copco LMS8-series impact wrenches deliver true raw power enabling extremely fast tightening & loosening', 'publish', 'open', 'closed', '', 'lms08-hr10-pneumatic-impact-wrench', '', '', '2016-01-06 23:03:10', '2016-01-06 23:03:10', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/lms08-hr10-pneumatic-impact-wrench/', 0, 'product', '', 0),
