(1249, 1, '2015-12-17 23:39:37', '2015-12-17 23:39:37', '<div class="col-md-12">\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco LMS8-Series Impact Wrenches</b> deliver true raw power and enable extremely fast tightening and loosening. The innovative and unique grease retaining system ensures maximum tool performance with long service intervals. For an impact wrench, the LMS8 also has extraordinarily low vibration levels. The LMS models are designed for use in the <b>Australian mining and construction industries</b>.</p>\n\n<ul>\n<li>Fast tightening and disassembly</li>\n<li>Negligible reaction force</li>\n<li>GRS - Grease Retaining System</li>\n<li>Low weight</li>\n<li>High power-to-weight ratio</li>\n<li>Tightening time should not exceed 5 seconds, to avoid excess wear on the tool</li>\n<li>Soft-start throttle</li>\n</ul><br />\n\n<p style="color: darkgrey; font-size: 16px; font-family: sans-serif;">Atlas Copco impact wrenches are designed to provide dependability and a long, trouble-free service life in the toughest conditions. Few other tools can match the Atlas Copco impact wrench when it comes to flexibility, capacity-to-weight ratio and simplicity in use and maintenance. The LMS models are non shut-off, which means they shut off once the operator releases the trigger.</p><br />\n\n<iframe src="https://www.youtube.com/embed/vEb_XFoqjrw" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\n</div>\n<div class="col-md-12" style="margin-top: 30px;">\n</div>', 'LMS08 HR42 Impact Wrench', 'Atlas Copco LMS8-series impact wrenches deliver true raw power enabling extremely fast tightening & loosening', 'inherit', 'closed', 'closed', '', '1244-autosave-v1', '', '', '2015-12-17 23:39:37', '2015-12-17 23:39:37', '', 1244, 'http://dev.dusted.com.au/dev_ease_woo/1244-autosave-v1/', 0, 'revision', '', 0),
(1446, 1, '2016-01-06 23:09:00', '2016-01-06 23:09:00', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco W2811 PRO Compact Line 1/2" Impact Wrenches</b> offer a high power-to-weight ratio & can tackle the toughest industrial jobs. Powered with an advanced twin hammer mechanism, these compact impacts deliver virtuoso performance, with state-of-the-art vibration damping & noise reduction technology.</p>\r\n\r\n<ul>\r\n	<li>Twin hammer impact mechanism for fast run-down </li>\r\n	<li>Robust fiber-glass reinforced composite housing</li>\r\n	<li>Important motor parts made of steel instead of aluminum for longer life-time</li>\r\n	<li>Three torque settings forward </li>\r\n	<li>Thumb reverse lever and torque setting integrated with the trigger for easy operation with one hand </li>\r\n	<li>Ergonomic rubber grip on handle for insulation and comfort</li>\r\n</ul><br />\r\n\r\n<p>Atlas Copco impact wrenches are designed to provide dependability and a long, trouble-free service life in the toughest conditions. Few other tools can match the Atlas Copco impact wrench when it comes to flexibility, capacity-to-weight ratio and simplicity in use and maintenance.</p>\r\n</div>\r\n<div class="col-md-12" style="margin-top: 10px;"></div>', 'W2811 PRO Compact Line Impact Wrench', 'Atlas Copco W2811 PRO Compact Line 1/2" Impact Wrenches offer a high power-to-weight ratio & can tackle the toughest industrial jobs', 'publish', 'open', 'closed', '', 'w2811pro-compact-line-impact-wrench', '', '', '2016-01-06 23:31:44', '2016-01-06 23:31:44', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/w2811pro-compact-line-impact-wrench/', 0, 'product', '', 0),
(1250, 1, '2015-12-18 00:01:35', '2015-12-18 00:01:35', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">The new <b>Boar Lightweight Series</b> Di RockDrills are designed for use in the <b>mining and construction industries</b>. Australian\r\ndesigned and European made according to exact engineering and <b>quality standards</b>.</p>\r\n<p style="color: darkgrey; font-size: 15px; font-family: sans-serif;">The new generation Boar Rockdrills are lighter and better balanced. These improvements have been achieved through a combination ol new designs, materials,\r\nheat treatment processes and manufacturing techniques. Three diflerent models are available, each suited to various ground and operating conditionsz.</p>\r\n&nbsp;\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;">\r\n<table style="width: 500px;" border="1" cellspacing="1" cellpadding="1">\r\n<tbody>\r\n<tr>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model Di</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Part\r\nNumber</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Impact\r\nRate</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Hz\r\nRotation</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;">Boar</span></td>\r\n<td><em><span style="color: #000000;">9 307 01</span></em></td>\r\n<td><em><span style="color: #000000;">3,100</span></em></td>\r\n<td><span style="color: #000000;">320 RPM</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;">Boar Max</span></td>\r\n<td><em><span style="color: #000000;">9 307 05</span></em></td>\r\n<td><em><span style="color: #000000;">2,750</span></em></td>\r\n<td><span style="color: #000000;"><strong>320</strong> RPM</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;">Max Plus</span></td>\r\n<td><em><span style="color: #000000;">9 307 13</spa