(1251, 1, '2015-12-18 00:02:47', '2015-12-18 00:02:47', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">Not only does the <b>Ingersoll Rand 2145QiMAX 3/4" Drive Impactool</b> deliver incredible performance &amp; industrial-grade durability, its efficient air motor also reduces air consumption.</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 1350 ft-lb maximum reverse torque from a tool that weighs just 3.4kg &amp; is compact enough to access tight spaces</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Durability</b>: Built to last &amp; designed to withstand tough use in rugged environments; two-year limited warranty is standard</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Productivity</b>: An air motor thatâ€™s 16% more efficient than its predecessor &amp; easy to clean inlet screen means less downtime, better tool performance, &amp; less money spent on compressed air.</p>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2145QiMAX Impact Wrench', 'Ingersoll Rand 2145QiMAX 3/4" Drive Impactool is an impact wrench that delivers incredible performance &amp; industrial-grade durability', 'publish', 'open', 'closed', '', '2145qimax-impact-wrench', '', '', '2016-01-06 03:52:13', '2016-01-06 03:52:13', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/2145qimax-impact-wrench/', 0, 'product', '', 0),
