(1272, 1, '2015-12-18 03:23:55', '2015-12-18 03:23:55', '<div class="col-md-12">\r\n\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Ingersoll Rand 2115TiMAX 3/8" Drive Impactool</b> delivers best in class performance for a tool less than six inches long & weighing less than two and a half pounds. The minimal size of this tool will allow greater access to tight spaces, while the minimal weight will reduce operator fatigue - all while still delivering MAX performance.</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 300 ft-lb MAX power in reverse from a tool less than 6" long</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Control</b>: Feather-touch trigger enables impressive control & one-hand forward/reverse for easy operation</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Reliability</b>: FREE two-year limited warranty with tool registration.</p>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2115TiMAX Impact Wrench', 'Ingersoll Rand 2115TiMAX 3/8" Drive Impactool delivers best in class performance for a tool less than six inches long & weighing less than two and a half pounds', 'publish', 'open', 'closed', '', '2115timax-impact-wrench', '', '', '2016-01-06 03:44:03', '2016-01-06 03:44:03', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/2115timax-impact-wrench/', 0, 'product', '', 0),
