(1275, 1, '2015-12-18 03:34:04', '2015-12-18 03:34:04', '<div class="col-md-12">\n\nThe 2115TiMAX delivers best in class performance for a tool less than six inches long and weighing less than two and a half pounds. The minimal size of this tool will allow greater access to tight spaces, while the minimal weight will reduce operator fatigueâ€¦all while still delivering MAX performance.\n\n\n<p style="color: black; font-size: 20px; font-family: sans-serif;">Not only does the <b>Ingersoll Rand 2145QiMAX 3/4" Drive Impactool</b> deliver incredible performance &amp; industrial-grade durability, its efficient air motor also reduces air consumption.</p>\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 300 ft-lb MAX power in reverse from a tool less than 6" long</p>\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Control</b>: Feather-touch trigger enables impressive control & one-hand forward/reverse for easy operation</p>\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Reliability</b>: FREE two-year limited warranty with tool registration.</p>\n\n</div>\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2115TiMAX  Impact Wrench', 'Ingersoll Rand 2115TiMAX delivers best in class performance for a tool less than six inches long and weighing less than two and a half pounds', 'inherit', 'closed', 'closed', '', '1272-autosave-v1', '', '', '2015-12-18 03:34:04', '2015-12-18 03:34:04', '', 1272, 'http://dev.dusted.com.au/dev_ease_woo/1272-autosave-v1/', 0, 'revision', '', 0),
