(1278, 1, '2015-12-18 04:07:22', '2015-12-18 04:07:22', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">The <em>ATEX Certified</em> <b>Ingersoll Rand 2145QiMAX-SP 3/4" Drive Impactool</b> provides best-in-class performance & ergonomics to maximize productivity and user comfort. Its industrial-grade durability & low air consumption also helps minimize operating costs.</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 1350 ft-lb maximum reverse torque from a compact tool that weighs just 3.35kg - Unique reverse-bias 7-vane motor delivers even more power in reverse</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Durability</b>: TwinHammer impact mechanism is the strongest, most durable & longest life mechanism in the industry - Steel hammercase provides excellent durability under the toughest use</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Productivity</b>: 4-position power regulator in forward helps adjusting the power to the application - FREE two-year limited warranty with tool registration.</p>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2145QiMAX-SP Impact Wrench', 'Ingersoll Rand 2145QiMAX-SP 3/4" Drive Impactool is an ATEX CERTIFIED impact wrench that delivers incredible performance & durability', 'publish', 'open', 'closed', '', '2145qimax-sp-impact-wrench', '', '', '2016-01-07 01:07:49', '2016-01-07 01:07:49', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/2145qimax-sp-impact-wrench/', 0, 'product', '', 0),
