(1284, 1, '2015-12-18 05:18:24', '2015-12-18 05:18:24', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">The <em>ATEX Certified</em> <b>Ingersoll Rand 2131PSP 1/2" Drive Impactool</b> delivers delivers plenty of power and superior control, along with unmatched reliability that comes from more than a century of proven engineering and innovation - perfect for any maintenance or repair application.</p>\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><em>ATEX certification EX I M2 c IIB 95Â°C X and EX II 2 GD c IIB 95Â°C X - allows this tool to be used in potentially explosive environments.</em></p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 813 Nm (600 ft-lb) of maximum torque in reverse - Powerful reverse-bias 6-vane motor delivers even more\r\npower in reverse</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Durability</b>: TwinHammer impact mechanism is the strongest, most durable & longest life mechanism in the industry - Steel hammercase provides excellent durability under the toughest use</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Productivity</b>: 4-position power regulator in forward helps adjusting the power to the application - 360Â° swivel inlet helps eliminating twisted hoses.</p>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2131PSP Impact Wrench', 'Ingersoll Rand 2131PSP 1/2" Drive Impactool is an ATEX CERTIFIED impact wrench that delivers incredible performance & durability', 'publish', 'open', 'closed', '', '2131psp-impact-wrench', '', '', '2016-01-07 01:06:45', '2016-01-07 01:06:45', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/2131psp-impact-wrench/', 0, 'product', '', 0),
