(1289, 1, '2015-12-18 06:08:03', '2015-12-18 06:08:03', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco LMP61 range of pistol grip nutrunners</b> deliver the highest possible torque and speed in relation to the weight of the tool. Fast, accurate and highly operator friendly, the tools are available in reversible versions for maximum flexibility.</p>\r\n\r\n<ul>\r\n	<li>Extremely good torque output to weight ratio compared to single motor pistol grip nutrunners</li>\r\n	<li>Twin motor concept - fast rundown saves time</li>\r\n	<li>Swiveling function makes tool positioning easy</li>\r\n	<li>High torque accuracy</li>\r\n	<li>Reversible</li>\r\n</ul><br />\r\n\r\n<p style="color: darkgrey; font-size: 18px; font-family: sans-serif;">Atlas Copco range of pistol grip nutrunners generate no process noise. By building up torque continuously, they are much quieter than impact wrenches. Unique twin-motor drive: one for high speed rundown, the other for high precision tightening. With a range consisting of 11 different tool sizes, there is an Atlas Copco Nutrunner to suit your needs. The smallest model delivers 60 Nm, while the largest supplies 4,000 Nm.</p>\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', 'Atlas Copco Torque Multiplier', 'Atlas Copco LMS8-series impact wrenches deliver true raw power enabling extremely fast tightening & loosening', 'publish', 'open', 'closed', '', 'lmp61-hr1500-25-torque-multiplier', '', '', '2016-01-06 03:34:53', '2016-01-06 03:34:53', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/lmp61-hr1500-25-torque-multiplier/', 0, 'product', '', 0),
(1292, 1, '2015-12-18 06:41:22', '2015-12-18 06:41:22', '<div class="col-md-12">\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco LMP61 range of pistol grip nutrunners</b> deliver the highest possible torque and speed in relation to the weight of the tool. Fast, accurate and highly operator friendly, the tools are available in reversible versions for maximum flexibility.</p>\n\n<ul>\n	<li>Extremely good torque output to weight ratio compared to single motor pistol grip nutrunners</li>\n	<li>Twin motor concept - fast rundown saves time</li>\n	<li>Swiveling function makes tool positioning easy</li>\n	<li>High torque accuracy</li>\n	<li>Reversible</li>\n</ul><br />\n\n<p style="color: darkgrey; font-size: 18px; font-family: sans-serif;">Atlas Copco range of pistol grip nutrunners generate no process noise. By building up torque continuously, they are much quieter than impact wrenches. </p>\n</div>\n<div class="col-md-12" style="margin-top: 30px;"></div>', 'LMP61 HR1500-25 Torque Multiplier', 'Atlas Copco LMS8-series impact wrenches deliver true raw power enabling extremely fast tightening & loosening', 'inherit', 'closed', 'closed', '', '1289-autosave-v1', '', '', '2015-12-18 06:41:22', '2015-12-18 06:41:22', '', 1289, 'http://dev.dusted.com.au/dev_ease_woo/1289-autosave-v1/', 0, 'revision', '', 0),
