(1337, 1, '2016-01-05 03:09:59', '2016-01-05 03:09:59', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">The air operated <b>ProTorc RWP55 Power Team Hydraulic Torque Wrench Pump</b> is the ideal choice of pump where air is the preferred power source and work is being done in hazardous or explosive environments. Suitable for underground mining applications.</p>\r\n\r\n<ul>\r\n<li>Use where air is the prefferred power source</li>\r\n<li>Powerful 2.2Kw motor starts under load</li>\r\n<li>External adjustable pressure regulator</li>\r\n<li>Retract side internal relief valve protects tool</li>\r\n<li>Suitable for use with single and double acting tools</li>\r\n<li>Safe to use in hazardous or explosive environments</li>\r\n<li>Can be fitted with roll cage for added protection and easier manoeuvrability</li>\r\n<li>Available with NATA traceable and certified gauges</li>\r\n<li>Filter Regulator / Lubricators available</li>\r\n<li>Four tool manifold option available (RWP55-4)</li>\r\n</ul>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 20px;">\r\n<table style="width: 900px;" border="1" cellspacing="1" cellpadding="1">\r\n<tbody>\r\n<tr>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Manifold</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Oil Delivery (L/min)</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Oil Reserviour</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Usable Oil</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Overall Width</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Overall Length</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Overall Height</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Weight w/oil</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>RWP 55</strong></span></td>\r\n<td><span style="color: #000000;">Single Tool</span></td>\r\n<td><span style="color: #000000;">7.6 @ 7 bar - 0.9 @ 700 bar</span></td>\r\n<td><span style="color: #000000;">9.5 L</span></td>\r\n<td><span style="color: #000000;">8.4 L</span></td>\r\n<td><span style="color: #000000;">450 mm</span></td>\r\n<td><span style="color: #000000;">280 mm</span></td>\r\n<td><span style="color: #000000;">483 mm</span></td>\r\n<td><span style="color: #000000;">44 kg</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'ProTorc Hydraulic Torque Wrench Pump', 'Air operated ProTorc RWP55 Hydraulic Torque Wrench Pumps are ideal where air is the preferred power source in hazardous / explosive environments', 'publish', 'open', 'closed', '', 'protorc-hydraulic-torque-wrench-pump', '', '', '2016-01-06 03:46:24', '2016-01-06 03:46:24', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/protorc-hydraulic-torque-wrench-pump/', 0, 'product', '', 0),
