(1412, 1, '2016-01-06 04:47:30', '2016-01-06 04:47:30', '<div class="col-md-12">\n<p style="color: black; font-size: 20px; font-family: sans-serif;">MILWAUKEE TOOLS Die Grinders</b> are â€œNothing but HEAVY DUTYâ€. MILWAUKEE''s extensive range of Grinders are engineered for professional users to get the job done better, faster, more reliably and safely.</p>\n<ul><li>MILWAUKEE TOOLS Die Grinders come with:</li>\n<ul><li>Variable speed for complete user control</li>\n<li>Softstart electronics for precise start of grinding</li>\n<li>Short and compact design enabling one-handed grinding</li>\n<li>Suitable for stationary use using the spindle neck</li>\n<li>Cut-off carbon brushes and metal gear box</li>\n<li>Lightweight and balanced</li></ul>\n</ul>\n</div>\n<div class="col-md-12" style="margin-top: 20px;">\n<table style="width: 780px;" border="1" cellspacing="1" cellpadding="1">\n<tbody>\n<tr>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model</span></td>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Collet Diameter</span></td>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Hole Diameter</span></td>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Spindle Thread</span></td>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Power</span></td>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Weight</span></td>\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Length</span></td>\n</tr>\n<tr>\n<td><span style="color: #000000;"><strong>DG30E</strong></span></td>\n<td><span style="color: #000000;">6mm (1/4") + 8mm</span></td>\n<td><span style="color: #000000;">16 mm</span></td>\n<td><span style="color: #000000;">M10 x 1.5</span></td>\n<td><span style="color: #000000;">840 W</span></td>\n<td><span style="color: #000000;">1.6 kg</span></td>\n<td><span style="color: #000000;">273 mm</span></td>\n</tr>\n<tr>\n<td><span style="color: #000000;"><strong>DGL30E</strong></span></td>\n<td><span style="color: #000000;">115 mm (4 1/2")</span></td>\n<td><span style="color: #000000;">22.2 mm</span></td>\n<td><span style="color: #000000;">M14 x 2</span></td>\n<td><span style="color: #000000;">1200 W</span></td>\n<td><span style="color: #000000;">1.9 kg</span></td>\n<td><span style="color: #000000;">321 mm</span></td>\n</tr>\n</tbody>\n</table>\n</div>', 'MILWAUKEE TOOLS Die Grinders', 'MILWAUKEE TOOLS Die Grinders are engineered for professional users to get the job done better, faster, more reliably and safely.</p>', 'inherit', 'closed', 'closed', '', '1384-autosave-v1', '', '', '2016-01-06 04:47:30', '2016-01-06 04:47:30', '', 1384, 'http://dev.dusted.com.au/dev_ease_woo/1384-autosave-v1/', 0, 'revision', '', 0),
(1426, 1, '2016-01-06 05:34:30', '2016-01-06 05:34:30', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>MILWAUKEE TOOLS Sliding Mitre Saws</b> are â€œNothing but HEAVY DUTYâ€. MILWAUKEE Sliding Mitre Saws are engineered for professional users to get the job done better, faster, more reliably and safely.</p>\r\n<ul><li>The MILWAUKEE TOOLS MS305DB Sliding Mitre Saw features:</li>\r\n<ul><li>Undoubtably the best saw in it''s class with 1800W Direct Drive Motor and constant power technology - provides increased power with constant speed under load. This ensures a quick, clean cut even in hardwood materials</li>\r\n<li>Digital mitre angle readout - provides repeatable accuracy to 0.1&#176;</li>\r\n<li>Dual integral jobsite lights - fully illuminate the work piece and cut line from either side of the blade</li>\r\n<li>Unique inline motor design for excellent visibility from both sides to the workpiece and better balanced transport</li>\r\n<li>Integral dust channel - captures 75% of all dust and debris cut by capturing dust near the cut on both sides of the blade and directing it to the back of the saw</li>\r\n<li>Mitre capacity 55&#176; to the left and 60&#176; to the right - for maximum versatility. Mitre detents L & R at: 0&#176;, 15&#176;, 22.5&#176;, 31.6&#176;, 45&#176; & 60&#176;</li>\r\n<li>Fine mitre adjustment function allows angle movements at 0.1&#176;</li>\r\n<li>Dual-bevel design - to incline the saw head left and right 0&#176; - 48&#176; with bevel detents L & R at: 0&#176;, 22.5&#176;, 33&#176;, 85&#176;, 45&#176; & 48&#176;</li></ul>\r\n</ul>\r\n</div>\r\n<div class="col-md-12" style="margin-top: 20px;">\r\n<table style="width: 500px;" border="1" cellspacing="1" cellpadding="1">\r\n<tbody>\r\n<tr>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Power Input</span></td>\r\n<td><span style="color