(1437, 1, '2016-01-06 22:00:00', '2016-01-06 22:00:00', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Ingersoll Rand 2155QiMAX 1" Drive Impactool</b> delivers incredible performance &amp; industrial-grade durability in an impact wrench. Plus, its efficient air motor reduces air consumption to save you money. Perfect for the most demanding applications, such as truck and bus service, construction and agricultural equipment maintenance, as well as the MRO market.</p>\r\n<br />\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 1350 ft-lb MAX Reverse Torque from a tool that weighs just 3.36kg &amp; which is compact enough to access tight spaces</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Durability</b>: Built to last &amp; designed to withstand tough use in rugged environments; a two-year limited warranty is standard</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Productivity</b>: An air motor thatâ€™s 16% more efficient than its predecessor &amp; an easy-to-clean inlet screen means less downtime, better tool performance, &amp; less money spent on compressed air</p>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2155QiMAX Impact Wrench', 'Ingersoll Rand 2155QiMAX 1" Drive Impactool delivers incredible performance &amp; industrial-grade durability in an impact wrench weighing &lt; 3.5kg', 'publish', 'open', 'closed', '', '2155qimax-impact-wrench', '', '', '2016-01-06 22:17:46', '2016-01-06 22:17:46', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/2155qimax-impact-wrench/', 0, 'product', '', 0),
