(1440, 1, '2016-01-06 22:35:18', '2016-01-06 22:35:18', '<div class="col-md-12">\r\n\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Ingersoll Rand 2135TiMAX 1/2" Drive Impactool</b> sets the standard for performance with the best power to weight ratio on the market in its class. The new 2135TiMAX raises the bar with 780 ft-lb MAX reverse torque weighing only 1.8 kg. The new design includes enhanced controls for even greater comfort and convenience. Ingersoll Rand are so confident with the durability of this tool they are backing it up with a 2 year warranty at no additional cost.</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Power</b>: 780 ft-lb MAX reverse torque and weighing less than 2 kg. Hard coat anodized end plate stands up to the toughest jobs. Optimized air flow ensures maximum performance.</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Control</b>: Feather-touch trigger enables impressive control & one-hand forward/reverse for easy operation</p>\r\n<p style="color: black; font-size: 16px; font-family: sans-serif;"><b>MAX Reliability</b>: FREE two-year limited warranty with tool registration.</p>\r\n\r\n</div>\r\n<div class="col-md-12" style="margin-top: 30px;"></div>', '2135TiMAX Impact Wrench', 'Ingersoll Rand 2135TiMAX 1/2" Drive Impactool sets the standard for performance with the best power to weight ratio on the market in its class', 'publish', 'open', 'closed', '', '2135timax-impact-wrench', '', '', '2016-01-06 22:55:14', '2016-01-06 22:55:14', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/2135timax-impact-wrench/', 0, 'product', '', 0),
