(1448, 1, '2016-01-06 23:26:18', '2016-01-06 23:26:18', '<div class="col-md-12">\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco W2811PRO Compact Line 1/2" Impact Wrenches</b> offer a high power-to-weight ratio & can tackle the toughest industrial jobs. Powered with an advanced twin hammer mechanism, these compact impacts deliver virtuoso performance, with state-of-the-art vibration damping & noise reduction technology.</p>\n\n<ul>\n	<li>Twin hammer impact mechanism for fast run-down </li>\n	<li>Robust fiber-glass reinforced composite housing</li>\n	<li>Important motor parts made of steel instead of aluminum for longer life-time</li>\n	<li>Three torque settings forward </li>\n	<li>Thumb reverse lever and torque setting integrated with the trigger for easy operation with one hand </li>\n	<li>Ergonomic rubber grip on handle for insulation and comfort</li>\n</ul><br />\n\n<p>Atlas Copco impact wrenches are designed to provide dependability and a long, trouble-free service life in the toughest conditions. Few other tools can match the Atlas Copco impact wrench when it comes to flexibility, capacity-to-weight ratio and simplicity in use and maintenance.</p>\n</div>\n<div class="col-md-12" style="margin-top: 10px;"></div>', 'W2811XP Compact Line Impact Wrench', 'Atlas Copco W2811PRO Compact Line 1/2" Impact Wrenches offer a high power-to-weight ratio & can tackle the toughest industrial jobs', 'inherit', 'closed', 'closed', '', '1446-autosave-v1', '', '', '2016-01-06 23:26:18', '2016-01-06 23:26:18', '', 1446, 'http://dev.dusted.com.au/dev_ease_woo/1446-autosave-v1/', 0, 'revision', '', 0),
(1451, 1, '2016-01-06 23:26:49', '2016-01-06 23:26:49', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">The <b>Atlas Copco W2811XP PRO Explosion Proof 1/2" Impact Wrench</b> meets stringent European standards and comply with ATEX Directive I M2 II 2G IIB T4 II2D 135&#176;. These explosion-proof products are designed for use in hazardous environments, such as coal mines, petrochemical plants, or wherever a spark-reduced safety tool is required. Powered with an advanced twin hammer mechanism these impacts can tackle the toughest industrial jobs.</p>\r\n\r\n<ul>\r\n	<li>Complies with ATEX Directive I M2 II 2G IIB T4 II2D 135&#176;</li>\r\n	<li>Twin hammer impact mechanism for fast run-down</li>\r\n	<li>Robust fibre-glass reinforced composite housing</li>\r\n	<li>Important motor parts made of steel instead of aluminum for longer life-time</li>\r\n	<li>Three torque settings</li>\r\n	<li>Ergonomic rubber grip on handle for insulation and comfort forward</li>\r\n	<li>Thumb reverse lever and torque setting integrated with the trigger for easy operation with one hand</li>\r\n</ul><br />\r\n\r\n<p>All Atlas Copco impact wrenches are designed to provide dependability and a long, trouble-free service life in the toughest conditions. Few other tools can match the Atlas Copco impact wrench when it comes to flexibility, capacity-to-weight ratio and simplicity in use and maintenance.</p>\r\n</div>\r\n<div class="col-md-12" style="margin-top: 10px;"></div>', 'W2811XP PRO Explosion Proof Impact Wrench', 'Atlas Copco W2811XP PRO Explosion Proof 1/2" Impact Wrench complies with ATEX Directive I M2 II 2G IIB T4 II2D 135&#176;', 'publish', 'open', 'closed', '', 'w2811xp-pro-explosion-proof-impact-wrench', '', '', '2016-01-07 01:05:22', '2016-01-07 01:05:22', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/w2811xp-pro-explosion-proof-impact-wrench/', 0, 'product', '', 0),
