(1455, 1, '2016-01-06 23:45:52', '2016-01-06 23:45:52', '<div class="col-md-12">\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Atlas Copco W2811XP PRO Explosion Proof 1/2" Impact Wrench</b> meets stringent European standards and comply with ATEX Directive I M2 II 2G IIB T4 II2D 135&#176;. These explosion-proof products are designed for use in hazardous environments, such as coal mines, petrochemical plants, or wherever a spark-reduced safety tool is required. Powered with an advanced twin hammer mechanism these impacts can tackle the toughest industrial job.</p>\n\n<ul>\n	<li>Complies with ATEX Directive I M2 II 2G IIB T4 II2D 135&#176;</li>\n	<li>Robust fiber-glass reinforced composite housing</li>\n	<li>Important motor parts made of steel instead of aluminum for longer life-time</li>\n	<li>Three torque settings forward </li>\n	<li>Thumb reverse lever and torque setting integrated with the trigger for easy operation with one hand </li>\n	<li>Ergonomic rubber grip on handle for insulation and comfort</li>\n</ul><br />\n\n<p>Atlas Copco impact wrenches are designed to provide dependability and a long, trouble-free service life in the toughest conditions. Few other tools can match the Atlas Copco impact wrench when it comes to flexibility, capacity-to-weight ratio and simplicity in use and maintenance.</p>\n</div>\n<div class="col-md-12" style="margin-top: 10px;"></div>', 'W2811XP PRO Explosion Proof Impact Wrench', 'Atlas Copco W2811XP PRO Explosion Proof 1/2" Impact Wrench complies with ATEX Directive I M2 II 2G IIB T4 II2D 135&#176;', 'inherit', 'closed', 'closed', '', '1451-autosave-v1', '', '', '2016-01-06 23:45:52', '2016-01-06 23:45:52', '', 1451, 'http://dev.dusted.com.au/dev_ease_woo/1451-autosave-v1/', 0, 'revision', '', 0),
