(1499, 1, '2016-01-07 04:21:16', '2016-01-07 04:21:16', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;"><b>Ingersoll Rand Die Grinders</b> provides automotive technicians & maintenance personnel with the muscle they need for tough grinding jobs. Cleaning surfaces, removing gaskets & general surface prep is no problem for our full line of straight & right angle grinders.</p>\r\n<div class="col-md-12" style="margin-top: 20px;">\r\n<table style="width: 700px;" border="1" cellspacing="1" cellpadding="1">\r\n<tbody>\r\n<tr>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Free Speed</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Output & Collet Size</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Power hp (kW)</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Weight</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>409</strong></span></td>\r\n<td><span style="color: #000000;">27000 RPM</span></td>\r\n<td><span style="color: #000000;">1/4" & 6 mm</span></td>\r\n<td><span style="color: #000000;">0.5 (0.4)</span></td>\r\n<td><span style="color: #000000;">0.54 kg</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>307B</strong></span></td>\r\n<td><span style="color: #000000;">28000 RPM</span></td>\r\n<td><span style="color: #000000;">1/4" & 6 mm</span></td>\r\n<td><span style="color: #000000;">0.25 (0.19)</span></td>\r\n<td><span style="color: #000000;">0.33 kg</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>308B</strong></span></td>\r\n<td><span style="color: #000000;">25000 RPM</span></td>\r\n<td><span style="color: #000000;">1/4" & 6 mm</span></td>\r\n<td><span style="color: #000000;">0.33 (0.25)</span></td>\r\n<td><span style="color: #000000;">0.46 kg</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>5108MAX</strong></span></td>\r\n<td><span style="color: #000000;">25000 RPM</span></td>\r\n<td><span style="color: #000000;">1/4" & 6 mm</span></td>\r\n<td><span style="color: #000000;">0.4 (0.3)</span></td>\r\n<td><span style="color: #000000;">0.46 kg</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n&nbsp;\r\n<p style="color: red; font-size: 17px; font-family: sans-serif;"><em>409 Air Die Grinder</em></p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>POWER</b>: 0.5 hp 4-vane motor with a free speed of 27,000 RPM delivers the power you need to tackle any application - from smoothing & polishing to deburring while its front exhaust keeps your work surfaces clean</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>DURABILITY</b>: Durable aluminium housing protects in tough conditions while keeping the tool light weight & comfortable to use</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>VALUE</b>: The 409 Air Die Grinder delivers the power you need at a cost you can afford, making it a staple in any well-rounded tool box</p>\r\n\r\n<p style="color: red; font-size: 17px; font-family: sans-serif;"><em>307B Air Die Grinder</em></p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>POWER</b>: 0.25 hp motor with a free speed of 28,000 RPM delivers the power you need to tackle any application - from porting, weld breaking, deburring & polishing</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>DURABILITY</b>: Strong Aluminium Housing withstands tough operating conditions enabling access to tight spots & a durable ball-bearing Construction improves balance & reduces vibration</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>SAFETY</b>: Safety-Lock Throttle Lever is easy to use & can prevent accidental start-up</p>\r\n\r\n<p style="color: red; font-size: 17px; font-family: sans-serif;"><em>308B Air Die Grinder</em></p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>POWER</b>: 0.33 hp motor with a free speed of 25,000 RPM delivers the power you need to tackle any application - from porting, weld breaking, deburring, polishing & grinding.</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>DURABILITY</b>: Composite housing protects tool from cold air and offers greater operator comfort</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>SAFETY</b>: The throttle lever prevents accidental start-up</p>\r\n\r\n<p style="color: red; font-size: 17px; font-family: sans-serif;"><em>5108MAX Air Die Grinder</em></p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>MAX POWER</b>: 0.4 hp and 25,000 RPM Motor delivers the power you need for the toughest jobs</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>MAX PERFORMANCE</b>: Lube Free Design eliminates oil contamination of your work environment</p>\r\n<p style="color: black; font-size: 14px; font-family: sans-serif;"><b>MAX COMFORT</b>: Enhanced Grip Design & Low-Profile Throttle Lever provides for extended run time without user fatigue</p>\r\n</div>', 'Ingersoll Rand Die Grinders', 'Ingersoll Rand Die Grinders are compact, lightweight, easy to handle & include all bearing construction for the utmost in durability', 'publish', 'open', 'closed', '', 'ingersoll-rand-die-grinders', '', '', '2016-01-07 22:47:26', '2016-01-07 22:47:26', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/ingersoll-rand-die-grinders/', 0, 'product', '', 0),
