(1527, 1, '2016-01-08 03:43:50', '2016-01-08 03:43:50', '<div class="col-md-12">\r\n<p style="color: black; font-size: 20px; font-family: sans-serif;">The <b>STID Die Grinders</b> are a lightweight polymer housing die grinder that are suitable for underground mining applications. STID Die Grinders were the first polymer housing die grinder on the market.</p>\r\n<ul>\r\n<li>The body of the die grinder provides protection against the "chill factor" common with air tools, & its properties also provide vibration protection as well.</li>\r\n<li>When you purchase the tool it comes with a basic service kit included adding great value</li>\r\n<li>This tool can also be fitted with an optional extra silencer assembly (Part# G-15A) to further reduce noise level<br /><em>*** Please note optional silencer assembly not suitable for underground applications ***</em></li>\r\n<li>Suitable for underground mining and hazardous environments</li>\r\n<li>Lightweight polymer housing</li>\r\n<li>Comfortable grip shaped handle</li>\r\n</ul>\r\n</div>\r\n<div class="col-md-12" style="margin-top: 10px;">\r\n<table style="width: 800px;" border="1" cellspacing="1" cellpadding="1">\r\n<tbody>\r\n<tr>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Model</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Collet Size</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Air Consumption</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Free Speed</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Throttle Type</span></td>\r\n<td><span style="color: #fda584; font-size: 18px; font-weight: bold;">Weight</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>ST1E-14</strong></span></td>\r\n<td><span style="color: #000000;">1/4"</span></td>\r\n<td><span style="color: #000000;">119 l/min - 4.2 cfm</span></td>\r\n<td><span style="color: #000000;">25000 RPM</span></td>\r\n<td><span style="color: #000000;">Safety Lever</span></td>\r\n<td><span style="color: #000000;">0.33 kg</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="color: #000000;"><strong>ST1E-6</strong></span></td>\r\n<td><span style="color: #000000;">1/4"</span></td>\r\n<td><span style="color: #000000;">119 l/min - 4.2 cfm</span></td>\r\n<td><span style="color: #000000;">25000 RPM</span></td>\r\n<td><span style="color: #000000;">Safety Lever</span></td>\r\n<td><span style="color: #000000;">0.33 kg</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 'STID Die Grinders', 'STID Die Grinders are lightweight polymer housing die grinders that are suitable for underground mining applications', 'publish', 'open', 'closed', '', 'stid-die-grinders', '', '', '2016-01-08 04:18:46', '2016-01-08 04:18:46', '', 0, 'http://dev.dusted.com.au/dev_ease_woo/product/stid-die-grinders/', 0, 'product', '', 0),
